<!DOCTYPE html>

    <head>
        <style>
            h1{
                text-align: center;
                font-weight: bold;
                font-family: 'Times New Roman', Times, serif;
            }
            body{
                margin: 0;
                background-color:  rgb(241, 241, 239);
            }
            .flags{
                display: flex;
                justify-content:space-evenly;
            }
            .flags img{
                height: 130px;
                width: 100%;
                display: flexbox;
            }
            .links {
            list-style-type: none;
            background-color: #2f2f2f;
            display:flex;
            justify-content: space-evenly;
            
            }
            .links a{
            
            color: rgb(238, 238, 238);
            text-decoration: none;
            }
            p{       
                text-align: center;        
                font-family: 'Times New Roman', Times, serif;
                font-size: large;
            }
            .Members{
                background-color: #2f2f2f;
                color: aliceblue;
                border-radius: 10px;
                height: 50px;
                margin-left: 300px;
                margin-right: 300px;
                display: flex;
                justify-content: space-evenly;
                
            }
            .Members li{
                justify-content: space-evenly;
                font-size: 30px;
                list-style-type: none;
            }
        </style>
